description:
When a girl brings her dead-beat boyfriend home to meet her mother, the older woman suddenly realizes that she had a completely wrong impression of the young man, and quickly realizes that her daughter just doesn't appreciate his charmingly sensual and romantic character. Soon, the mother steals the young man away from her daughter, finally giving him what the daughter couldn't.

James Deen, Evan Stone, Chastity Lynn, Ariella Ferrera, Sasha Monroe, Micheal Vegas


